//  Utility to extract numeric rating
function getStarValue(starString) {
    const match = starString.match(/(\d(\.\d)?)/);
    return match ? parseFloat(match[0]) : 0;
}

//  Assign random price based on star rating
hotels.forEach(hotel => {
    const star = getStarValue(hotel.hotel_star_rating);
    let min = 800, max = 1200;

    if (star === 0) [min, max] = [800, 1200];
    else if (star === 1) [min, max] = [1000, 2000];
    else if (star === 2) [min, max] = [1500, 3000];
    else if (star === 3) [min, max] = [3000, 7000];
    else if (star === 4) [min, max] = [6000, 10000];
    else if (star === 5) [min, max] = [9000, 16000];

    hotel.price = Math.floor(Math.random() * (max - min + 1)) + min;
});